import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => (
    <nav>
        <ul>
            <li><Link to="/sales">Sales</Link></li>
            <li><Link to="/humans">Humans</Link></li>
            <li><Link to="/queries">Queries</Link></li>
        </ul>
    </nav>
);

export default Sidebar;
